      .586
      .MODEL FLAT,STDCALL
      .STACK 4096
      option casemap :none  ; case sensitive

include stars.inc
include lines.inc
include trig.inc
include blit.inc
include game.inc

;; Windows includes
include \masm32\include\winmm.inc
includelib \masm32\lib\winmm.lib
include \masm32\include\user32.inc
includelib \masm32\lib\user32.lib

;; I get an internal assembler error (A1016) if windows.inc is included
;; include \masm32\include\windows.inc

;; These lines are copied definitions from windows.inc
SND_FILENAME = 20000h
SND_LOOP = 8h
SND_ASYNC = 1h
SND_NODEFAULT = 2h
SND_NOSTOP = 10h

;; Has keycodes
include keys.inc

OBJECTS_SIZE = 100 ;; Constant of max game objects

.DATA?

    GameObjects GameObject OBJECTS_SIZE DUP(<?>)
    SpawnedObjects DWORD ?
    STATIC_OBJECTS DWORD ?

    lastPlayed DWORD ? ;; Pointer to last played filename

    ;; Data flags
    hasSpawned WORD ? ;; Set bits to track which objects have already been spawned (see game.inc for values)
.CODE

;; Returns the absolute value of a
AbsoluteValue PROC a:SDWORD

    mov eax, a
    cmp eax, 0
    jge SKIP
    neg eax
SKIP:
    ret
AbsoluteValue ENDP

;; Returns nonzero if field has all bits in flag set, 0 otherwise
CheckFlag PROC field:WORD, flag:WORD

    mov ax, field
    and ax, flag
    cmp eax, 0
    je EXIT

    cmp ax, flag
    je TRUE
    xor eax, eax
    jmp EXIT

TRUE:
    mov eax, 1
    ;; Fallthrough
EXIT:
    ret
CheckFlag ENDP

;; Same behavior as CheckFlag, but for the less common doubleword case
CheckFlagd PROC field:DWORD, flag:DWORD

    mov eax, field
    and eax, flag
    cmp eax, 0
    je EXIT

    cmp eax, flag
    je TRUE
    xor eax, eax
    jmp EXIT

TRUE:
    mov eax, 1
    ;; Fallthrough
EXIT:
    ret
CheckFlagd ENDP

;; Plays the music whose filename is in file
Play PROC USES eax esi file:PTR BYTE

    mov esi, file

    cmp esi, lastPlayed
    je SKIP
    mov lastPlayed, esi
    mov lastlooped, 0
    INVOKE PlaySound, esi, 0, SND_FILENAME OR SND_ASYNC OR SND_NODEFAULT
SKIP:
    ret
Play ENDP

;; Like Play, but loops the effect
;; Shares lastPlayed
PlayLoop PROC USES eax esi file:PTR BYTE

    mov esi, file

    cmp esi, lastPlayed
    je SKIP
    INVOKE PlaySound, esi, 0, SND_FILENAME OR SND_ASYNC OR SND_NODEFAULT OR SND_LOOP OR SND_NOSTOP
    cmp eax, 0 ;; If we didn't actually play sound, don't set our trackers
    je SKIP
    mov lastPlayed, esi
    mov lastlooped, 1
SKIP:
    ret
PlayLoop ENDP

;; Interrupts playback iff the last played effect was looping
InterruptLoops PROC USES eax

    cmp lastlooped, 0
    je SKIP
    INVOKE PlaySound, 0, 0, 0
    mov lastlooped, 0
    mov lastPlayed, 0
SKIP:
    ret
InterruptLoops ENDP

CheckIntersect PROC USES ebx ecx edi esi oneX:DWORD, oneY:DWORD, oneBitmap:PTR EECS205BITMAP, twoX:DWORD, twoY:DWORD, twoBitmap:PTR EECS205BITMAP

    mov esi, oneBitmap
    mov edi, twoBitmap

    ;; Null pointer checks (do not check collisions of null bitmaps)
    cmp esi, 0
    je FALSE ;; Nothing can't collide with something
    cmp edi, 0
    je FALSE ;; Nothing can't collide with something

    ;; ebx contains the sum of halfwidths as a DWORD (not FXPT)
    INVOKE ToFixedPoint, (EECS205BITMAP PTR [esi]).dwWidth
    INVOKE FixedMultiply, eax, HALF
    mov ebx, eax
    INVOKE ToFixedPoint, (EECS205BITMAP PTR [edi]).dwWidth
    INVOKE FixedMultiply, eax, HALF
    INVOKE FixedAdd, ebx, eax
    INVOKE FromFixedPoint, eax
    mov ebx, eax

    ;; ecx contains the sum of halfheights
    INVOKE ToFixedPoint, (EECS205BITMAP PTR [esi]).dwHeight
    INVOKE FixedMultiply, eax, HALF
    mov ecx, eax
    INVOKE ToFixedPoint, (EECS205BITMAP PTR [edi]).dwHeight
    INVOKE FixedMultiply, eax, HALF
    INVOKE FixedAdd, ecx, eax
    INVOKE FromFixedPoint, eax
    mov ecx, eax

    ;; If the difference between xcenters is greater than or equal to ebx, return 0
    mov eax, twoX
    sub eax, oneX
    INVOKE AbsoluteValue, eax
    cmp eax, ebx
    jge FALSE

    ;; If the difference between ycenters is greater than or equal to ecx, return 0
    mov eax, twoY
    sub eax, oneY
    INVOKE AbsoluteValue, eax
    cmp eax, ecx
    jge FALSE

    ;; If we get here, then there exists some overlap
    mov eax, 1
    jmp EXIT

FALSE:
    mov eax, 0
    ;; Fallthrough
EXIT:
    ret
CheckIntersect ENDP

GameInit PROC USES eax ecx edi esi

    ;; No objects have spawned at the beginning of the game
    mov hasSpawned, 0

    ;; No sound has been played at the beginning of the game
    mov lastPlayed, 0

    ;; Initialize the player (who is always the first object in the GameObjects array)
    mov edi, OFFSET GameObjects
    mov (GameObject PTR [edi]).sprite, OFFSET fighter_000

    INVOKE ToFixedPoint, SCREEN_WIDTH/2
    mov (GameObject PTR [edi]).xcenter, eax

    INVOKE ToFixedPoint, SCREEN_HEIGHT/2
    mov (GameObject PTR [edi]).ycenter, eax

    mov (GameObject PTR [edi]).xvelocity, ZERO
    mov (GameObject PTR [edi]).yvelocity, ZERO
    mov (GameObject PTR [edi]).rotation, ZERO

    ;; Spawn the player with four frames of rotational velocity
    INVOKE FixedMultiply, ROT_INC, 0040000h
    mov (GameObject PTR [edi]).rvelocity, eax

    ;; Player doesn't get any flags set
    mov (GameObject PTR [edi]).flags, 0

    ;; Special object for showing RCS exhaust for fighter rotation (must immediately follow the player)
    add edi, SIZEOF GameObject
    ;; Start with no sprite
    ;; No transforms (handled by flag)
    ;; No velocities (Overridden by flag)
    ;; Ignores collisions, and copies transforms of the player
    mov (GameObject PTR [edi]).flags, COPY_TRANSFORMS
    or (GameObject PTR [edi]).flags, COLLISION_IGNORE
    mov (GameObject PTR [edi]).pExtra, OFFSET GameObjects

    ;; Powerup slot for the player
    add edi, SIZEOF GameObject
    ;; No initial sprite, transforms, flag, velocities, or extra
    ;; This is all handled by the code which attaches it, but this is the reserved space for it

    ;; Initialize the first asteroid using movsb
    add edi, SIZEOF GameObject
    mov esi, OFFSET asteroid0_initial
    mov ecx, SIZEOF GameObject
    rep movsb

    ;; Second asteroid
    add edi, SIZEOF GameObject
    ;; No data, will be copied in later

    ;; Third asteroid
    add edi, SIZEOF GameObject
    ;; No data, will be copied in later

    ;; Fourth asteroid
    add edi, SIZEOF GameObject
    ;; No data, will be copied in later

    ;; Shield powerup collectible
    ;; Just copy it over from its static location using movsb
    add edi, SIZEOF GameObject
    mov esi, OFFSET shield_powerup
    mov ecx, SIZEOF GameObject
    rep movsb

    ;; Set spawnedobjects
    mov SpawnedObjects, 9
    mov STATIC_OBJECTS, 9
	ret         ;; Do not delete this line!!!
GameInit ENDP

;; Draws a game object using RotateBlit, checking for null-ness
DrawGameObject PROC USES eax ebx esi edi ptrObject:PTR GameObject

    mov esi, ptrObject
    cmp (GameObject PTR [esi]).sprite, 0 ;; Null check
    je SKIP

    ;; Do not draw transform-copying objects following a null sprite
    INVOKE CheckFlag, (GameObject PTR [esi]).flags, COPY_TRANSFORMS
    cmp eax, 0
    je DRAW
    ;; Check to see if the object is following a null sprite
    mov edi, (GameObject PTR [esi]).pExtra
    cmp (GameObject PTR [edi]).sprite, 0
    je SKIP

DRAW:
    INVOKE FromFixedPoint, (GameObject PTR [esi]).xcenter
    mov ebx, eax

    INVOKE FromFixedPoint, (GameObject PTR [esi]).ycenter

    INVOKE RotateBlit, (GameObject PTR [esi]).sprite, ebx, eax, (GameObject PTR [esi]).rotation
SKIP:
    ret
DrawGameObject ENDP

;; Draws all game objects, in order
DrawGame PROC USES ecx esi edi

    ;; Copy background bytes into the screen buffer
    mov ecx, SCREEN_WIDTH*SCREEN_HEIGHT
    mov esi, OFFSET background
    mov edi, ScreenBitsPtr
    rep movsb

    ;; Initializer
    mov esi, OFFSET GameObjects
    mov ecx, 0

TOP: ;; Drawing loop
    INVOKE DrawGameObject, esi
    inc ecx
    add esi, SIZEOF GameObject

    ;; Condition
    cmp ecx, OBJECTS_SIZE
    jl TOP

    ;; If the gameover object exists, draw it over everything
    ;; (It can't be in the GameObjects list, or else it would participate in collisions)
    mov esi, OFFSET endgame
    cmp (GameObject PTR [esi]).sprite, 0
    je SKIP
    INVOKE DrawGameObject, esi

SKIP:
    ;; Display score
    push gamescore
    push offset scoreFmtStr
    push offset scoreStr
    call wsprintf
    add esp, 12
    mov esi, OFFSET scoreStr
    INVOKE DrawStr, esi, 0, 440, 255

    ;; If the game is paused, draw the paused message at the center of the screen
    cmp paused, 0
    jle EXIT
    mov esi, OFFSET paused_sprite
    INVOKE BasicBlit, esi, SCREEN_WIDTH/2, SCREEN_HEIGHT/2
EXIT:
    ret
DrawGame ENDP

;; Ticks a game object
UpdateGameObject PROC USES eax ebx ecx edx esi edi ptrObject:PTR GameObject

    mov esi, ptrObject

    INVOKE CheckFlag, (GameObject PTR [esi]).flags, RESPAWNING_OBJECT ;; Handle respawning objects
    cmp eax, 0
    je COPY
    cmp (GameObject PTR [esi]).sprite, 0 ;; Check if the object is dead
    jne COPY
    mov eax, frameCount
    cmp eax, (GameObject PTR [esi]).tag ;; Check if the target frame has passed
    jl COPY

    ;; It is time to respawn esi
    mov edi, (GameObject PTR [esi]).pRespawn
    xchg esi, edi ;; For movsb
    mov ecx, SIZEOF GameObject
    rep movsb

    mov esi, ptrObject ;; So update can continue

COPY:
    INVOKE CheckFlag, (GameObject PTR [esi]).flags, COPY_TRANSFORMS ;; Handle following objects
    cmp eax, 0
    je TRANSFORM

    mov edi, (GameObject PTR [esi]).pExtra ;; GameObject whose transforms we're copying
    ;; Copy xcenter, ycenter, and rotation from edi to esi
    mov ebx, (GameObject PTR [edi]).xcenter
    mov (GameObject PTR [esi]).xcenter, ebx
    mov ebx, (GameObject PTR [edi]).ycenter
    mov (GameObject PTR [esi]).ycenter, ebx
    mov ebx, (GameObject PTR [edi]).rotation
    mov (GameObject PTR [esi]).rotation, ebx
    jmp SKIP ;; Do not perform normal update

TRANSFORM:
    mov edi, (GameObject PTR [esi]).sprite
    cmp edi, 0 ;; Null check
    je SKIP

    ;; First, update x coordinate
    INVOKE FixedAdd, (GameObject PTR [esi]).xcenter, (GameObject PTR [esi]).xvelocity
    ;; Wraparound: For simplicity (and added game difficulty), wraparound objects when they're entirely offscreen
    mov ebx, eax
    mov eax, (EECS205BITMAP PTR [edi]).dwWidth
    INVOKE ToFixedPoint, eax
    INVOKE FixedMultiply, eax, HALF
    neg eax
    cmp ebx, eax ;; If center is a halfwidth past 0, wraparound
    jge CND2
    INVOKE FixedSubtract, SCREEN_WIDTH_FXPT, eax ;; Rubberband: Can't go very far off screen
    INVOKE FixedSubtract, eax, ONE
    jmp MOVX

CND2:
    mov eax, (EECS205BITMAP PTR [edi]).dwWidth
    INVOKE ToFixedPoint, eax
    INVOKE FixedMultiply, eax, HALF
    INVOKE FixedAdd, SCREEN_WIDTH_FXPT, eax
    xchg ebx, eax ;; So the jump will have correct eax
    cmp eax, ebx ;; If center is a halfwidth past screen width, wraparound
    jle MOVX
    mov eax, (EECS205BITMAP PTR [edi]).dwWidth
    INVOKE ToFixedPoint, eax
    INVOKE FixedMultiply, eax, HALF
    neg eax
    ;; Fallthrough
MOVX:
    mov (GameObject PTR [esi]).xcenter, eax

    ;; Now, update y coordinate
    INVOKE FixedAdd, (GameObject PTR [esi]).ycenter, (GameObject PTR [esi]).yvelocity
    ;; Wraparound: For simplicity (and added game difficulty), wraparound objects when they're entirely offscreen
    mov ebx, eax
    mov eax, (EECS205BITMAP PTR [edi]).dwHeight
    INVOKE ToFixedPoint, eax
    INVOKE FixedMultiply, eax, HALF
    neg eax
    cmp ebx, eax ;; If center is a halfwidth past 0, wraparound
    jge CND3
    INVOKE FixedSubtract, SCREEN_HEIGHT_FXPT, eax ;; Rubberband: Can't go very far off screen
    INVOKE FixedSubtract, eax, ONE
    jmp MOVY

CND3:
    mov eax, (EECS205BITMAP PTR [edi]).dwHeight
    INVOKE ToFixedPoint, eax
    INVOKE FixedMultiply, eax, HALF
    INVOKE FixedAdd, SCREEN_HEIGHT_FXPT, eax
    xchg ebx, eax ;; So the jump will have correct eax
    cmp eax, ebx ;; If center is a halfwidth past screen width, wraparound
    jle MOVY
    mov eax, (EECS205BITMAP PTR [edi]).dwHeight
    INVOKE ToFixedPoint, eax
    INVOKE FixedMultiply, eax, HALF
    neg eax
    ;; Fallthrough
MOVY:
    mov (GameObject PTR [esi]).ycenter, eax

    ;; Finally, update rotation
    INVOKE FixedAdd, (GameObject PTR [esi]).rotation, (GameObject PTR [esi]).rvelocity
    ;; Ensure rotation does not exceed 2 pi or go under 0
CND0:
    cmp eax, ROTATION
    jl CND1
    cmp eax, TWO_PI
    jg SUB0
    ;; If rotation is almost, but not quite, 2pi, set it to zero (avoiding a bug with overrotated sprite draws)
    mov (GameObject PTR [esi]).rotation, ZERO
    jmp SKIP

SUB0:
    INVOKE FixedSubtract, eax, TWO_PI
CND1:
    cmp eax, EPSILON
    jg MOVE
    cmp eax, ZERO
    jl ADD0
    ;; If rotation is almost, but not quite, 0, set it to zero (avoiding a bug with underrotated sprite draws)
    mov (GameObject PTR [esi]).rotation, ZERO
    jmp SKIP

ADD0:
    INVOKE FixedAdd, eax, TWO_PI
    jmp CND0 ;; Make sure that both conditions are simultaneously satisfied
MOVE:
    mov (GameObject PTR [esi]).rotation, eax
SKIP:
    ret
UpdateGameObject ENDP

;; Invoked on end of game
GameOver PROC USES esi

    ;; Set the special endgame gameobject to show the endgame screen
    mov esi, OFFSET endgame
    mov (GameObject PTR [esi]).sprite, OFFSET gameover

    ;; Properly center object
    INVOKE FixedMultiply, SCREEN_WIDTH_FXPT, HALF
    mov (GameObject PTR [esi]).xcenter, eax

    ;; Play game over track
    mov esi, OFFSET endGameSound
    INVOKE Play, esi
    ret
GameOver ENDP

;; Attaches the collectible object in ptrObject to the player
Collect PROC USES ecx esi edi ptrObject:PTR GameObject

    mov esi, ptrObject
    mov edi, OFFSET GameObjects+2*SIZEOF GameObject

    ;; Use memory copy to fill the powerup slot
    mov ecx, SIZEOF GameObject
    rep movsb
    ret
Collect ENDP

;; Deflects a and b away from each other post-collision
DeflectObjects PROC USES eax ebx edx edi esi a:PTR GameObject, b:PTR GameObject

    mov esi, a
    mov edi, b

    xor edx, edx ;; edx tracks whether we have made any velocity changes

    ;; Deflect based on the difference between centers.
    ;; If one center is within a halfdimension of the other along that axis, negate it's motion along the other

    ;; Start with esi along x
    INVOKE FixedSubtract, (GameObject PTR [esi]).xcenter, (GameObject PTR [edi]).xcenter
    INVOKE AbsoluteValue, eax ;; Distance between xcenters
    mov ebx, eax
    mov eax, (GameObject PTR [edi]).sprite
    INVOKE FixedMultiply, (EECS205BITMAP PTR [eax]).dwWidth, HALF
    cmp ebx, eax ;; Compare difference between xcenters to half of edi's width
    jg EDIX ;; If distance<halfwidth, invert esi.yvelocity
    neg (GameObject PTR [esi]).yvelocity
    or edx, 1

EDIX: ;; Now, edi along x
    ;; ebx still holds xcenter distance
    mov eax, (GameObject PTR [esi]).sprite
    INVOKE FixedMultiply, (EECS205BITMAP PTR [eax]).dwWidth, HALF
    cmp ebx, eax ;; Compare difference between xcenters to half of esi's width
    jg ESIY ;; If distance<halfwidth, invert edi.yvelocity
    neg (GameObject PTR [edi]).yvelocity
    or edx, 00010000h

ESIY: ;; Now, esi along y
    INVOKE FixedSubtract, (GameObject PTR [esi]).ycenter, (GameObject PTR [edi]).ycenter
    INVOKE AbsoluteValue, eax ;; Distance between ycenters
    mov ebx, eax

    ;; Skip compare if we inverted esi last time
    INVOKE CheckFlagd, edx, 1
    cmp eax, 0
    jne EDIY

    ;; If we didn't invert esi last time, check if we should this time
    mov eax, (GameObject PTR [edi]).sprite
    INVOKE FixedMultiply, (EECS205BITMAP PTR [eax]).dwHeight, HALF
    cmp ebx, eax ;; Compare difference between ycenters to half of edi's height
    jg EDIY ;; If distance<halfheight, invert esi.xvelocity
    neg (GameObject PTR [esi]).xvelocity
    or edx, 2

EDIY: ;; Now, edi along ycenter
    ;; ebx still holds ycenter distance

    ;; Skip compare if we inverted edi last time
    INVOKE CheckFlagd, edx, 00010000h
    cmp eax, 0
    jne CORNERY ;; Don't need to double check if we know we inverted edi already

    ;; If we didn't invert esi last time, check if we should this time
    mov eax, (GameObject PTR [esi]).sprite
    INVOKE FixedMultiply, (EECS205BITMAP PTR [eax]).dwWidth, HALF
    cmp ebx, eax ;; Compare difference between ycenters to half of esi's height
    jg CORNERD ;; If distance<halfheight, invert edi.xvelocity
    neg (GameObject PTR [edi]).xvelocity
    or edx, 00020000h

CORNERD: ;; If neither of edi's velocities were changed, it was a corner hit on edi
    mov eax, edx
    and eax, 0ffff0000h
    cmp eax, 0 ;; Check if edx has either of edi's potential flags set
    jne CORNERY
    ;; Invert both of edi's translational velocities if edi has not had any change
    neg (GameObject PTR [edi]).xvelocity
    neg (GameObject PTR [edi]).yvelocity

CORNERY: ;; If neither of esi's velocities were changed, it was a corner hit on esi
    and edx, 0000ffffh
    cmp edx, 0 ;; Check if edx has either of esi's potential flags set
    jne ROTATIONS
    ;; Invert both of esi's translational velocities if esi has not had any change
    neg (GameObject PTR [esi]).xvelocity
    neg (GameObject PTR [esi]).yvelocity

ROTATIONS: ;; Invert both rotational velocities and exit
    neg (GameObject PTR [edi]).rvelocity
    neg (GameObject PTR [esi]).rvelocity
    ret
DeflectObjects ENDP

;; Checks for collisions with all game objects, in order
;; ptrObject is the first object to check collisions for (against all after it)
;; Index is the index this object appears in in the GameObjects list
;; Handles collisions by itself: Does not return a value
;; If more than two objects collide simultaneously, only the first two in GameObjects are handled
CollideGameObject PROC USES esi edi eax ebx ecx edx ptrObject:PTR GameObject, index:DWORD
    LOCAL oneX:DWORD, oneY:DWORD

    ;; Initializer
    mov esi, ptrObject
    cmp (GameObject PTR [esi]).sprite, 0 ;; Null check: Ignore collisions with non-drawing objects
    je EXIT
    INVOKE CheckFlag, (GameObject PTR [esi]).flags, COLLISION_IGNORE ;; Check for non-colliding object
    cmp eax, 0
    jne EXIT

    mov edi, ptrObject
    add edi, SIZEOF GameObject
    cmp (GameObject PTR [esi]).sprite, 0 ;; Null check: Ignore collisions with non-drawing objects
    je EXIT

    mov ecx, index
    inc ecx ;; ecx has the index of the second object

    ;; Locals setup
    INVOKE FromFixedPoint, (GameObject PTR [esi]).xcenter
    mov oneX, eax
    INVOKE FromFixedPoint, (GameObject PTR [esi]).ycenter
    mov oneY, eax
    ;; Now that we don't need the GameObject data from esi, set it to the sprite (as it's slightly faster to do so)
    mov esi, (GameObject PTR [esi]).sprite

TOP: ;; Collision loop
    INVOKE CheckFlag, (GameObject PTR [edi]).flags, COLLISION_IGNORE ;; Check for non-colliding objects
    cmp eax, 0
    jne COND

    INVOKE CheckFlag, (GameObject PTR [edi]).flags, COLLISION_NONPLAYER ;; Check for non-player colliding objects
    cmp eax, 0
    je NORMAL
    cmp index, 0 ;; Check for if esi is the player
    je COND ;; Continue checking if the flag is set and the collision is being checked against the player

NORMAL:
    INVOKE FromFixedPoint, (GameObject PTR [edi]).xcenter
    mov ebx, eax
    INVOKE FromFixedPoint, (GameObject PTR [edi]).ycenter
    INVOKE CheckIntersect, oneX, oneY, esi, ebx, eax, (GameObject PTR [edi]).sprite
    cmp eax, 0
    jne COLLISION

COND:
    inc ecx
    add edi, SIZEOF GameObject

    ;; Condition
    cmp ecx, OBJECTS_SIZE
    jl TOP
    jmp EXIT

COLLISION: ;; ptrObject collided with edi
    mov esi, ptrObject

    ;; For the time being, just 'delete' both objects, unless they're both marked as deflecting
    INVOKE CheckFlag, (GameObject PTR [edi]).flags, COLLISION_DEFLECT
    cmp eax, 0
    je NODEFLECT
    INVOKE CheckFlag, (GameObject PTR [esi]).flags, COLLISION_DEFLECT
    cmp eax, 0
    je NODEFLECT
    INVOKE DeflectObjects, edi, esi
    jmp COND ;; Deflecting objects may still collide on the deflecting frame

NODEFLECT:
    INVOKE CheckFlag, (GameObject PTR [edi]).flags, COLLISION_COLLECTIBLE ;; Check for collectible object
    cmp eax, 0
    je CONT
    cmp index, 0 ;; Check if we're checking against the player
    jne COND ;; If not, go back and check against
    INVOKE Collect, (GameObject PTR [edi]).pExtra
    ;; Delete the collected powerup object
    mov (GameObject PTR [edi]).sprite, 0

    ;; Check if the collectible is respawning, and if so, set its tag properly
    INVOKE CheckFlag, (GameObject PTR [edi]).flags, RESPAWNING_OBJECT
    cmp eax, 0
    je L1
    mov eax, frameCount
    add (GameObject PTR [edi]).tag, eax
L1: ;; I'm running out of label names
    jmp COND ;; Return to checking more collisions, since this one didn't delete the player

CONT: ;; Check to see if esi is collectible (we should also ignore that collision)
    INVOKE CheckFlag, (GameObject PTR [esi]).flags, COLLISION_COLLECTIBLE
    cmp eax, 0
    je NOCOLLECT
    ;; We know that we're not checking against the player (esi will always be the player when the player is involved in a collision)
    ;; So just unconditionally skip this collision
    jmp COND

NOCOLLECT:
    INVOKE CheckFlag, (GameObject PTR [edi]).flags, COLLISION_NODELETE ;; Check for non-deleting object
    cmp eax, 0
    jne SKIP
    mov (GameObject PTR [edi]).sprite, 0

    ;; Check if the object is respawning, and if so, set its tag properly
    INVOKE CheckFlag, (GameObject PTR [edi]).flags, RESPAWNING_OBJECT
    cmp eax, 0
    je BOUNTY
    mov eax, frameCount
    add (GameObject PTR [edi]).tag, eax

BOUNTY:
    ;; Check if the object grants a bounty, and if so, grant the appropriate number of points
    INVOKE CheckFlag, (GameObject PTR [edi]).flags, KILL_SCORE
    cmp eax, 0
    je SKIP
    mov edi, (GameObject PTR [edi]).pExtra
    add gamescore, edi

    ;; Fallthrough
SKIP:
    INVOKE CheckFlag, (GameObject PTR [esi]).flags, COLLISION_NODELETE ;; Check for non-deleting object
    cmp eax, 0
    jne EXIT
    mov (GameObject PTR [esi]).sprite, 0

    ;; Check if the object is respawning, and if so, set its tag properly
    INVOKE CheckFlag, (GameObject PTR [esi]).flags, RESPAWNING_OBJECT
    cmp eax, 0
    je BOUNTY2
    mov eax, frameCount
    add (GameObject PTR [esi]).tag, eax

BOUNTY2:
    ;; Check if the object grants a bounty, and if so, grant the appropriate number of points
    INVOKE CheckFlag, (GameObject PTR [esi]).flags, KILL_SCORE
    cmp eax, 0
    je EXIT
    mov esi, (GameObject PTR [esi]).pExtra
    add gamescore, esi
    ;; Fallthrough
EXIT:
    ret
CollideGameObject ENDP

;; Spawns any objects that are due to spawn on this frame
SpawnObjects PROC USES  ecx esi edi

    ;; By checking objects in order of spawntime, we can stop after we're before one spawn time

    cmp gamescore, SPAWNTIME_ASTEROID1
    jl EXIT

    INVOKE CheckFlag, hasSpawned, SPAWNED_ASTEROID1
    cmp eax, 0
    jne AST2

    ;; Spawn asteroid1 initial using movsb
    mov edi, OFFSET GameObjects+4*SIZEOF GameObject
    mov esi, OFFSET asteroid1_initial
    mov ecx, SIZEOF GameObject
    rep movsb
    ;; Set flag for having spawned asteroid1
    or hasSpawned, SPAWNED_ASTEROID1

AST2:
    cmp gamescore, SPAWNTIME_ASTEROID2
    jl EXIT

    INVOKE CheckFlag, hasSpawned, SPAWNED_ASTEROID2
    cmp eax, 0
    jne AST3

    ;; Spawn asteroid2 initial using movsb
    mov edi, OFFSET GameObjects+5*SIZEOF GameObject
    mov esi, OFFSET asteroid2_initial
    mov ecx, SIZEOF GameObject
    rep movsb
    ;; Set flag for having spawned asteroid2
    or hasSpawned, SPAWNED_ASTEROID2

AST3:
    cmp gamescore, SPAWNTIME_ASTEROID3
    jl EXIT

    INVOKE CheckFlag, hasSpawned, SPAWNED_ASTEROID3
    cmp eax, 0
    jne EXIT

    ;; Spawn asteroid3 initial using movsb
    mov edi, OFFSET GameObjects+6*SIZEOF GameObject
    mov esi, OFFSET asteroid3_initial
    mov ecx, SIZEOF GameObject
    rep movsb
    ;; Set flag for having spawned asteroid3
    or hasSpawned, SPAWNED_ASTEROID3
EXIT:
    ret
SpawnObjects ENDP

;; Resets the game
RestartGame PROC USES edi eax ecx

    mov gamescore, 0
    mov frameCount, 0
    mov SinceFire, -1

    ;; Zero out all gameobjects
    mov edi, OFFSET GameObjects
    mov ecx, SIZEOF GameObjects
    xor eax, eax
    rep stosb

    ;; Un-end the game
    mov edi, OFFSET endgame
    mov (GameObject PTR [edi]).sprite, 0

    ;; Stop sound effects
    INVOKE Play, 0

    ;; Reinitialize the game
    INVOKE GameInit
    ret
RestartGame ENDP

;; Updates all game objects, in order
UpdateGame PROC USES eax ecx esi edi

CHECK:    ;; Don't update when the game is paused
    cmp paused, 0
    jle UPDATE
    inc paused ;; Paused counts how many frames the game has been paused for
    cmp KeyPress, VK_P
    jne EXIT
    cmp paused, MIN_PAUSE
    jle EXIT ;; Game will not unpause in the first 15 frames
    mov paused, -MIN_PAUSE
    mov KeyPress, 0 ;; Do not take keyboard on the first frame after unpause

UPDATE:
    cmp paused, 0
    je ENABLE
    inc paused

ENABLE:
    ;; Stop performing updates if the game is over
    mov esi, OFFSET endgame
    cmp (GameObject PTR [esi]).sprite, 0
    jne RESTART

    ;; Increment time since last fire (cooldown)
    inc SinceFire

    ;; Increment game score
    inc gamescore

    ;; Increment frame counter (for respawns)
    inc frameCount

    ;; Spawn any needed objects
    INVOKE SpawnObjects

    ;; Initializer
    mov esi, OFFSET GameObjects
    mov ecx, 0

TOP: ;; Tick loop
    cmp esi, OFFSET gameover ;; Bug protection: Throw a tarp over the bug whose source I can't find
    je EXIT

    INVOKE UpdateGameObject, esi
    INVOKE CollideGameObject, esi, ecx

     ;; Check for game over
    cmp ecx, 0
    jne SKIP
    cmp (GameObject PTR [esi]).sprite, 0
    jne SKIP
    INVOKE GameOver ;; If the player has a null sprite, then the game is over
    jmp EXIT
SKIP:
    inc ecx
    add esi, SIZEOF GameObject

    ;; Condition
    cmp ecx, OBJECTS_SIZE
    jl TOP

    ;; Perform user interaction
    mov esi, OFFSET GameObjects ;; Use esi for the fighter sprite
    mov edi, OFFSET GameObjects ;; Use EDI for the RCS bitmap
    add edi, SIZEOF GameObject

    cmp KeyPress, VK_LEFT
    jne K1
    mov eax, OFFSET rcs_path
    INVOKE PlayLoop, eax
    mov (GameObject PTR [edi]).sprite, OFFSET rcs_ccw ;; Set RCS sprite
    INVOKE FixedAdd, (GameObject PTR [esi]).rvelocity, ROT_INC
    cmp eax, MAX_RVELOCITY
    jg M1 ;; Be nice to the player, and limit their rotational velocity to make it easier to maintain control
    mov (GameObject PTR [esi]).rvelocity, eax
    jmp M1

K1:
    cmp KeyPress, VK_RIGHT
    jne K2
    mov eax, OFFSET rcs_path
    INVOKE PlayLoop, eax
    mov (GameObject PTR [edi]).sprite, OFFSET rcs_cw ;; Set RCS sprite
    INVOKE FixedSubtract, (GameObject PTR [esi]).rvelocity, ROT_INC
    cmp eax, -MAX_RVELOCITY
    jl M1 ;; Be nice to the player, and limit their rotational velocity to make it easier to maintain control
    mov (GameObject PTR [esi]).rvelocity, eax
    jmp M1

K2: ;; TODO: This should accelerate the player
    ;; Since neither left or right is being pressed, clear the RCS bitmap
    mov (GameObject PTR [edi]).sprite, 0
    cmp KeyPress, VK_UP
    jne NOPRESS

    ;; Play "engines" sound effect
    mov eax, OFFSET engines_path
    INVOKE PlayLoop, eax

    ;; Set engines-on fighter sprite
    ;; Choice of sprite varies per-frame, starting on fighter_002
    cmp (GameObject PTR [esi]).sprite, OFFSET fighter_002
    jne ODD
    mov (GameObject PTR [esi]).sprite, OFFSET fighter_001
    jmp ACCELERATE
ODD:
    mov (GameObject PTR [esi]).sprite, OFFSET fighter_002
    ;; Fallthrough
ACCELERATE: ;; Accelerate fighter
    INVOKE FixedSin, (GameObject PTR [esi]).rotation
    INVOKE FixedMultiply, eax, ACCEL
    neg eax
    INVOKE FixedAdd, eax, (GameObject PTR [esi]).xvelocity
    mov (GameObject PTR [esi]).xvelocity, eax
    INVOKE FixedCos, (GameObject PTR [esi]).rotation
    INVOKE FixedMultiply, eax, ACCEL
    neg eax
    INVOKE FixedAdd, eax, (GameObject PTR [esi]).yvelocity
    mov (GameObject PTR [esi]).yvelocity, eax
    jmp M1

NOPRESS: ;; Set normal fighter sprite
    mov (GameObject PTR [esi]).sprite, OFFSET fighter_000
    INVOKE InterruptLoops

K3: ;; Begin pause
    cmp KeyPress, VK_P
    jne K4
    mov paused, 1
    jmp M1

K4: ;; Alias space to mouse leftclick
    cmp KeyPress, VK_SPACE
    jne M1
    mov edi, OFFSET MouseStatus
    or (MouseInfo PTR [edi]).buttons, MK_LBUTTON

M1:
    mov edi, OFFSET MouseStatus
    mov ecx, (MouseInfo PTR [edi]).buttons
    and ecx, MK_LBUTTON
    cmp ecx, 0
    je EXIT

    ;; Do not fire if the blaster is cooling down
    cmp SinceFire, BLAST_COOLDOWN
    jb EXIT
    mov SinceFire, 0 ;; Place the blaster on cooldown

    cmp SpawnedObjects, OBJECTS_SIZE ;; Make sure we don't overflow the array
    jl SPAWN
    mov ecx, STATIC_OBJECTS ;; Start overwriting old objects (non-blast objects must come first in the array)
    mov SpawnedObjects, ecx

SPAWN:
    mov ecx, OFFSET blast_path
    INVOKE Play, ecx

    imul ecx, SpawnedObjects, SIZEOF GameObject
    inc SpawnedObjects
    mov edi, OFFSET GameObjects
    add edi, ecx

    mov (GameObject PTR [edi]).sprite, OFFSET blast

    mov ecx, OFFSET blast
    INVOKE ToFixedPoint, (EECS205BITMAP PTR [ecx]).dwHeight
    INVOKE FixedMultiply, eax, HALF
    mov ecx, eax
    mov eax, (GameObject PTR [esi]).sprite

    INVOKE ToFixedPoint, (EECS205BITMAP PTR [eax]).dwHeight
    INVOKE FixedMultiply, eax, HALF
    INVOKE FixedAdd, eax, 15*ONE
    mov ecx, eax ;; ecx contains the goal offset

    INVOKE FixedSin, (GameObject PTR [esi]).rotation
    INVOKE FixedMultiply, eax, ecx
    INVOKE FixedSubtract, (GameObject PTR [esi]).xcenter, eax
    mov (GameObject PTR [edi]).xcenter, eax

    INVOKE FixedCos, (GameObject PTR [esi]).rotation
    INVOKE FixedMultiply, eax, ecx
    INVOKE FixedSubtract, (GameObject PTR [esi]).ycenter, eax
    mov (GameObject PTR [edi]).ycenter, eax

    ;; Blast is a uniform sphere, so rotation is irrelevant
    mov (GameObject PTR [edi]).rotation, ZERO
    mov (GameObject PTR [edi]).rvelocity, ZERO

    INVOKE FixedSin, (GameObject PTR [esi]).rotation
    INVOKE FixedMultiply, eax, BLAST_VELOCITY
    INVOKE FixedSubtract, (GameObject PTR [esi]).xvelocity, eax
    mov (GameObject PTR [edi]).xvelocity, eax

    INVOKE FixedCos, (GameObject PTR [esi]).rotation
    INVOKE FixedMultiply, eax, BLAST_VELOCITY
    INVOKE FixedSubtract, (GameObject PTR [esi]).yvelocity, eax
    mov (GameObject PTR [edi]).yvelocity, eax
    ;; Fallthrough
EXIT:
    ;; Prevents sticking fire and accidental fire queuing
    mov edi, OFFSET MouseStatus
    and (MouseInfo PTR [edi]).buttons, NOT MK_LBUTTON

    ret

RESTART:
    ;; Enable game restart iff the game is over
    cmp KeyPress, VK_R
    jne EXIT
    INVOKE RestartGame
    jmp EXIT
UpdateGame ENDP

GamePlay PROC

    INVOKE DrawGame
    INVOKE UpdateGame
	ret         ;; Do not delete this line!!!
GamePlay ENDP

